-- file name: root/concept/database/database.sql

--
-- table structure for table `concept_actor`
--

create table "concept_actor" (
  "actor_id" serial not null ,
  "fullname" varchar(250) null ,
  "last_update" timestamp null default now(),
  primary key ("actor_id")
);


--
-- table structure for table `concept_category`
--

create table "concept_category" (
  "category_id" smallint not null ,
  "name" varchar(25) null ,
  primary key ("category_id")
);


--
-- table structure for table `concept_customers`
--

create table "concept_customers" (
  "customernumber" serial not null ,
  "customername" varchar(50) null ,
  "contactlastname" varchar(50) null ,
  "contactfirstname" varchar(50) null ,
  "phone" varchar(50) null ,
  "addressline1" varchar(50) null ,
  "addressline2" varchar(50) null ,
  "city" varchar(50) null ,
  "state" varchar(50) null ,
  "postalcode" varchar(15) null ,
  "country" varchar(50) null ,
  "salesrepemployeenumber" integer null ,
  "creditlimit" double precision null ,
  primary key ("customernumber")
);


--
-- table structure for table `concept_employees`
--

create table "concept_employees" (
  "employeenumber" serial not null ,
  "lastname" varchar(50) null ,
  "firstname" varchar(50) null ,
  "extension" varchar(10) null ,
  "email" varchar(100) null ,
  "officecode" integer null ,
  "file_url" varchar(250) null ,
  "jobtitle" varchar(50) null ,
  primary key ("employeenumber")
);


--
-- table structure for table `concept_film`
--

create table "concept_film" (
  "film_id" serial not null ,
  "title" varchar(255) null ,
  "description" text null ,
  "release_year" smallint null ,
  "rental_duration" smallint null default 3.,
  "rental_rate" numeric(4,2) null default 4.9900000000000002,
  "length" integer null ,
  "replacement_cost" numeric(5,2) null default 19.989999999999998,
  "rating" char(255) null default 'g',
  "special_features" char(255) null ,
  "last_update" timestamp null default now(),
  primary key ("film_id")
);


--
-- table structure for table `concept_film_actor`
--

create table "concept_film_actor" (
  "actor_id" integer not null ,
  "film_id" integer not null ,
  "priority" integer null
);


--
-- table structure for table `concept_film_category`
--

create table "concept_film_category" (
  "film_id" integer not null ,
  "category_id" smallint not null
);


--
-- table structure for table `concept_offices`
--

create table "concept_offices" (
  "officecode" serial not null ,
  "city" varchar(50) null ,
  "phone" varchar(50) null ,
  "addressline1" varchar(50) null ,
  "addressline2" varchar(50) null ,
  "state" varchar(50) null ,
  "country" varchar(50) null ,
  "postalcode" varchar(15) null ,
  "territory" varchar(10) null ,
  primary key ("officecode")
);


--
-- table structure for table `concept_orderdetails`
--

create table "concept_orderdetails" (
  "ordernumber" integer not null ,
  "productcode" varchar(15) null ,
  "quantityordered" integer null ,
  "priceeach" double precision null ,
  "orderlinenumber" smallint null ,
  primary key ("ordernumber", "productcode")
);


--
-- table structure for table `concept_orders`
--

create table "concept_orders" (
  "ordernumber" serial not null ,
  "orderdate" timestamp null ,
  "requireddate" timestamp null ,
  "shippeddate" timestamp null ,
  "status" char(255) null ,
  "comments" text null ,
  "customernumber" integer null ,
  primary key ("ordernumber")
);


--
-- table structure for table `concept_payments`
--

create table "concept_payments" (
  "customernumber" integer not null ,
  "checknumber" varchar(50) null ,
  "paymentdate" timestamp null ,
  "amount" double precision null ,
  primary key ("customernumber","checknumber")
);


--
-- table structure for table `concept_productlines`
--

create table "concept_productlines" (
  "productline" varchar(50) not null ,
  "textdescription" varchar(4000) null ,
  "htmldescription" text null ,
  "image" bytea null ,
  primary key ("productline")
);


--
-- table structure for table `concept_products`
--

create table "concept_products" (
  "productcode" varchar(15) not null ,
  "productname" varchar(70) null ,
  "productline" varchar(50) null ,
  "productscale" varchar(10) null ,
  "productvendor" varchar(50) null ,
  "productdescription" text null ,
  "quantityinstock" smallint null ,
  "buyprice" double precision null ,
  "msrp" double precision null ,
  primary key ("productcode")
);


