insert into "concept_productlines" ("productline","textdescription","htmldescription","image") values ('vintage cars','our vintage car models realistically portray automobiles produced from the early 1900s through the 1940s. materials used include bakelite, diecast, plastic and wood. most of the replicas are in the 1:18 and 1:24 scale sizes, which provide the optimum in detail and accuracy. prices range from $30.00 up to $180.00 for some special limited edition replicas. all models include a certificate of authenticity from their manufacturers and come fully assembled and ready for display in the home or office.',null,null),('ships','the perfect holiday or anniversary gift for executives, clients, friends, and family. these handcrafted model ships are unique, stunning works of art that will be treasured for generations! they come fully assembled and ready for display in the home or office. we guarantee the highest quality, and best value.',null,null),('trains','model trains are a rewarding hobby for enthusiasts of all ages. whether you''re looking for collectible wooden trains, electric streetcars or locomotives, you''ll find a number of great choices for any budget within this category. the interactive aspect of trains makes toy trains perfect for young children. the wooden train sets are ideal for children under the age of 5.',null,null),('planes','unique, diecast airplane and helicopter replicas suitable for collections, as well as home, office or classroom decorations. models contain stunning details such as official logos and insignias, rotating jet engines and propellers, retractable wheels, and so on. most come fully assembled and with a certificate of authenticity from their manufacturers.',null,null),('motorcycles','our motorcycles are state of the art replicas of classic as well as contemporary motorcycle legends such as harley davidson, ducati and vespa. models contain stunning details such as official logos, rotating wheels, working kickstand, front suspension, gear-shift lever, footbrake lever, and drive chain. materials used include diecast and plastic. the models range in size from 1:10 to 1:50 scale and include numerous limited edition and several out-of-production vehicles. all models come fully assembled and ready for display in the home or office. most include a certificate of authenticity.',null,null),('classic cars','attention car enthusiasts: make your wildest car ownership dreams come true. whether you are looking for classic muscle cars, dream sports cars or movie-inspired miniatures, you will find great choices in this category. these replicas feature superb attention to detail and craftsmanship and offer features such as working steering system, opening forward compartment, opening rear trunk with removable spare wheel, 4-wheel independent spring suspension, and so on. the models range in size from 1:10 to 1:24 scale and include numerous limited edition and several out-of-production vehicles. all models include a certificate of authenticity from their manufacturers and come fully assembled and ready for display in the home or office.',null,null),('trucks and buses','the truck and bus models are realistic replicas of buses and specialized trucks produced from the early 1920s to present. the models range in size from 1:12 to 1:50 scale and include numerous limited edition and several out-of-production vehicles. materials used include tin, diecast and plastic. all models include a certificate of authenticity from their manufacturers and are a perfect ornament for the home and office.',null,null);

