insert into "concept_products" ("productcode","productname","productline","productscale","productvendor","productdescription","quantityinstock","buyprice","msrp") values ('s10_1678','1969 harley davidson ultimate chopper','motorcycles','1:10','min lin diecast','this replica features working kickstand, front suspension, gear-shift lever, footbrake lever, drive chain, wheels and steering. all parts are particularly delicate due to their precise scale and require special care and attention.',7933,48.81,95.7),('s10_1949','1952 alpine renault 1300','classic cars','1:10','classic metal creations','turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.',7305,98.58,214.3),('s10_2016','1996 moto guzzi 1100i','motorcycles','1:10','highway 66 mini classics','official moto guzzi logos and insignias, saddle bags located on side of motorcycle, detailed engine, working steering, working suspension, two leather seats, luggage rack, dual exhaust pipes, small saddle bag located on handle bars, two-tone paint with chrome accents, superior die-cast detail , rotating wheels , working kick stand, diecast metal with plastic parts and baked enamel finish.',6625,68.99,118.94),('s10_4698','2003 harley-davidson eagle drag bike','motorcycles','1:10','red start diecast','model features, official harley davidson logos and insignias, detachable rear wheelie bar, heavy diecast metal with resin parts, authentic multi-color tampo-printed graphics, separate engine drive belts, free-turning front fork, rotating tires and rear racing slick, certificate of authenticity, detailed engine, display stand
, precision diecast replica, baked enamel finish, 1:10 scale model, removable fender, seat and tank cover piece for displaying the superior detail of the v-twin engine',5582,91.02,193.66),('s10_4757','1972 alfa romeo gta','classic cars','1:10','motor city art classics','features include: turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.',3252,85.68,136),('s10_4962','1962 lanciaa delta 16v','classic cars','1:10','second gear diecast','features include: turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.',6791,103.42,147.74),('s12_1099','1968 ford mustang','classic cars','1:12','autoart studio design','hood, doors and trunk all open to reveal highly detailed interior features. steering wheel actually turns the front wheels. color dark green.',68,95.34,194.57),('s12_1108','2001 ferrari enzo','classic cars','1:12','second gear diecast','turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.',3619,95.59,207.8),('s12_1666','1958 setra bus','trucks and buses','1:12','welly diecast productions','model features 30 windows, skylights & glare resistant glass, working steering system, original logos',1579,77.9,136.67),('s12_2823','2002 suzuki xreo','motorcycles','1:12','unimax art galleries','official logos and insignias, saddle bags located on side of motorcycle, detailed engine, working steering, working suspension, two leather seats, luggage rack, dual exhaust pipes, small saddle bag located on handle bars, two-tone paint with chrome accents, superior die-cast detail , rotating wheels , working kick stand, diecast metal with plastic parts and baked enamel finish.',9997,66.27,150.62),('s12_3148','1969 corvair monza','classic cars','1:18','welly diecast productions','1:18 scale die-cast about 10" long doors